INSERT INTO `articles` (`id`, `title`, `slug`, `author`, `body`, `featured_image`, `status`, `published_at`, `created`, `modified`) VALUES
	(11, 'Pemkot Surabaya Kerek Pendapatan dari Pajak Reklame', 'Pemkot-Surabaya-Kerek-Pendapatan-dari-Pajak-Reklame', 1, '<p xss="removed" data-bind="text: $data"><span xss="removed"><b>SUMBER PENDAPATAN: Papan reklame banyak berdiri di Jalan Basuki Rahmat. Pemkot menargetkan pendapatan pajak reklame tahun ini naik.</b></span></p><p xss="removed" data-bind="text: $data">SURABAYA – Pendapatan asli daerah (PAD) yang ditetapkan pemkot dari pajak reklame ditargetkan meningkat tahun ini. Padahal, sempat terjadi penurunan tren reklame pada 2017. Meski begitu, pemkot optimistis jumlah reklame kembali menggeliat naik pada 2018.</p><p xss="removed" data-bind="text: $data">Sepanjang 2017 dinas cipta karya dan tata ruang (DCKTR) mengeluarkan 1.659 izin reklame. Angka tersebut menurun meski hanya terhitung puluhan unit. Selama 2016 DCKTR memberikan izin untuk 1.719 reklame.</p><p xss="removed" data-bind="text: $data">Kepala Bidang Tata Ruang DCKTR Lasidi menjelaskan bahwa penurunan terjadi karena dua hal. ’’Pertama, kemungkinan ada yang diturunkan atau tidak diperpanjang,’’ ujarnya. Selain itu, pembangunan dan pelebaran jalan yang dilakukan pemkot membuat sejumlah titik reklame tergusur.</p><p xss="removed" data-bind="text: $data">Bukan hanya itu. Reklame diperkirakan cenderung sepi karena kondisi ekonomi yang lesu selama 2017. ’’Perusahaan dituntut untuk memenuhi gaji buruh lebih dulu,’’ jelas Kepala Dinas Pengelola Keuangan dan Pajak Daerah (BPKPD) Yusron Sumartono. Atas alasan itu, anggaran untuk promosi atau beriklan lewat reklame pun tidak menjadi prioritas. Tidak heran jika sepanjang tahun lalu banyak papan reklame yang akhirnya kosong.</p><p xss="removed" data-bind="text: $data">Yusron membenarkan bahwa cukup banyak papan reklame yang tidak disewa dalam kurun waktu beberapa bulan. Yang cukup ramai justru iklan dengan media baliho atau banner yang waktu penggunaannya lebih singkat. ’’Biasanya, baliho dan</p><p xss="removed" data-bind="text: $data">banner itu tayangnya cuma sehari sampai dua hari,’’ tuturnya.</p><p xss="removed" data-bind="text: $data">Sepinya reklame terlihat dari realisasi PAD yang ngepres. Berdasar Perubahan APBD 2017, pemkot menargetkan nilai PAD dari reklame sebesar Rp 131 miliar. Realisasinya pun di sekitar angka yang sama.</p><p xss="removed" data-bind="text: $data">Meski begitu, untuk tahun anggaran 2018, Yusron menyatakan ada peningkatan. PAD reklame dinaikkan Rp 2 miliar dari tahun lalu.</p><p xss="removed" data-bind="text: $data"><b>Sumber : </b>https://www.pressreader.com/indonesia/jawa-pos/20180111/283437781899454</p>', '180720052542_getimage.jpg', 1, '20-07-2018', '1532057142', '1532057142'),
	(12, 'Pajak Reklame, Apa Itu dan Bagaimana Perhitungannya?2', 'Pajak-Reklame-Apa-Itu-dan-Bagaimana-Perhitungannya2', 1, '<p><span xss="removed">Reklame menjadi media promosi paling digemari bagi pengusaha di kota besar. Namun sayangnya, tidak semua orang tahu bagaimana caranya menghitung pajak reklame serta berapa tarif keseluruhan untuk memasang reklame di pinggir jalan. Reklame itu sendiri, </span><a title="ada berbagai macam" href="https://www.cermati.com/artikel/mengenal-macam-macam-pajak-untuk-bisnis-online" target="_blank" xss="removed">ada berbagai macam</a><span xss="removed">. Setiap jenis memiliki golongan wajib pajak yang berbeda-beda. Sejauh ini, reklame masih menjadi cara yang efektif untuk tujuan memperkenalkan atau mempromosikan barang, jasa, orang atau badan yang dapat diketahui oleh khalayak umum. Reklame bisa berbentuk papan,reklame peragaan, reklame selebaran, stiker, kain, reklame berjalan dan lain sebagainya. Selain itu reklame juga difungsikan untuk menganjurkan atau menarik perhatian umum terhadap sesuatu yang diperlihatkan.</span></p><p><span xss="removed"><b>Reklame Produk dan Non Produk</b></span><br></p><p><span xss="removed"><span xss="removed">Secara garis besar reklame dibedakan menjadi dua jenis yaitu Reklame Produk dan Reklame Non-Produk. Kita mengambil contoh Peraturan Gubernur DKI Jakarta sebagai acuan dalam mendefinisikan kedua istilah tersebut. Pertama, Reklame Produk adalah reklame yang berisi tentang suatu barang atau jasa dimana tujuan reklame tersebut semata-mata untuk keperluan promosi sesuai dengan Pergub DKI Jakarta Pasal 1 angka 11 Nomor 27 Tahun 2014. Kemudian berdasarkan Pergub Nomor 27 tahun 2014 Pasal 1 angka 10, menyatakan bahwa Reklame Non Produk adalah jenis reklame yang semata-mata memuat nama perusahaan/badan/nama profesi atau usaha, termasuk juga logo, simbol atau identitas badan/perusahaan dan usaha yang dapat diketahui oleh khalayak umum.</span></span></p><p><span xss="removed"><span xss="removed"><span xss="removed">\r\n      </span></span></span></p><p xss="removed">Sering kali kita bingung untuk membedakan kedua jenis reklame tersebut. Misalnya, Pak Ahmad sebagai ketua Lembaga Pendidikan B ingin mengenalkan sekolahnya ke khalayak umum dengan segenap program, serta visi misinya. Dalam kasus ini berarti Pak Ahmad sedang ingin mengenalkan atau mempromosikan sebuah lembaga pendidikan. Lantas pertanyaannya, reklame apa yang sesuai untuk Pak Ahmad? Apakah reklame produk atau non-produk? Untuk menjawab pertanyaan tersebut Pak Ahmad harus menentukan dulu apa yang ingin dimuat dalam reklame tersebut, apakah hanya sebatas logo serta nama sekolah terkait atau beserta dengan jasa/produk sekolah sebagai suatu yang dikomersilkan? Jika hanya sebatas nama dan logo sekolah, maka kategori reklame yang dipilih Pak Ahmad adalah reklame non produk. Jika ada jasa maupun produk komersil yang dimuat maka, bisa saja reklame tersebut termasuk pada reklame produk.</p><p xss="removed"><span xss="removed"><b>Mengenal Lebih Jauh tentang Pajak Reklame</b></span><br></p><p xss="removed"><span xss="removed"><img alt="Pajak Reklame" src="https://image.cermati.com/f_auto,q_70/nxftdgiqral3wgabsogt" xss="removed" width="796" height="478"></span></p><p xss="removed">Pernahkah  anda berencana untuk menyewa sebuah billboard besar di tepi jalan untuk mempromosikan sebuah produk atau jasa yang anda miliki akan tetapi belum tahu bagaimana caranya dan apa saja yang perlu dipersiapkan? Pada kesempatan ini kami akan membahas tentang bagaimana cara mengurus pemasangan reklame secara umum dan berapa biaya yang dibutuhkan untuk perijinan pajak reklame tersebut.</p><p xss="removed">Pajak reklame adalah konsekuensi wajib pajak yang dikenakan kepada individu atau badan usaha atas penyelenggaraan reklame. Wajib pajak penyelenggaraan reklame telah diatur dalam Undang-Undang No. 28 tahun 2009 tentang Pajak Daerah dan Retribusi Daerah. Oleh karena itu dalam pelaksanaannya, pajak reklame diatur kembali oleh masing-masing daerah melalui Peraturan Daerah, Peraturan Gubernur ataupun Peraturan Bupati.</p><p xss="removed"><b>Ada beberapa hal yang dikecualikan dan tidak termasuk ke dalam <a title="wajib pajak" href="https://www.cermati.com/artikel/apa-fungsi-dan-manfaat-memiliki-npwp-cek-di-sini" target="_blank" xss="removed">wajib pajak</a> reklame, yaitu:</b></p><ol xss="removed">\r\n      <li xss="removed">Reklame yang diselenggarakan melalui media cetak, media elektronik dan internet.</li>\r\n      <li xss="removed">Reklame yang diselenggarakan oleh Pemerintah Pusat atau Pemerintah Daerah.</li>\r\n      <li xss="removed">Reklame untuk nama tempat ibadah seperti masjid, gereja, serta panti asuhan.</li>\r\n      <li xss="removed">Reklame untuk tanah yang terletak di tanah tersebut dengan ukuran tidak lebih dari 1 m2.</li>\r\n      <li xss="removed">Reklame yang diselenggarakan oleh Perwakilan Luar negeri</li>\r\n      <li xss="removed">Merek produk atau label yang terdapat pada barang dagangan yang berfungsi untuk membedakan dari produk sejenis di pasaran.</li>\r\n      </ol><p xss="removed">Kalau di atas sudah disinggung siapa saja yang berkewajiban untuk membayar wajib pajak reklame, maka ada pertanyaan lagi yang sering ditanyakan, yaitu bagaimana jika reklame tersebut diselenggarakan melalui pihak ketiga? Perlu diingat bahwa wajib pajak reklame dikenakan kepada individu/pribadi atau badan yang menyelenggarakan reklame. Jika reklame itu diselenggarakan secara langsung oleh pribadi atau badan maka wajib pajak reklame adalah badan atau orang pribadi yang bersangkutan tersebut. Jika reklame diselenggarakan melalui pihak ketiga, maka wajib pajak adalah pihak ketiga yang menyelenggarakan reklame tersebut. Hal ini sangat penting diketahui untuk menghitung NSR (Nilai Sewa Reklame) sebagai acuan untuk menetapkan tarif pajak.</p><p xss="removed">Pada poin selanjutnya akan dibahas tentang apa itu NSR dan kaitannya dalam penentuan pajak reklame baik bagi individu/sendiri maupun pihak ketiga.</p><p xss="removed"><span xss="removed"><b>Cara Menghitung Tarif Pajak Reklame</b></span><br></p><p xss="removed"><span xss="removed"><img alt="Pajak Reklame" src="https://image.cermati.com/f_auto,q_70/udimhkmvpbqsu9e2mesp" xss="removed" width="796" height="475"></span></p><p xss="removed">Sebenarnya kalau berbicara mengenai besaran pajak reklame, hal itu sudah ada ketentuannya yaitu sebesar 25?ri NSR (Nilai Sewa Reklame). Mengenai besaran atau jumlah pajak reklame itu sangat tergantung pada faktor yang mempengaruhi tentang besaran nilai sewa reklame (NSR) tersebut. Faktor-faktor yang mempengaruhi besaran NSR sangat ditentukan oleh siapa penyelenggara reklame, jenis reklame (produk atau non-produk), dan juga faktor lainnya.. Untuk reklame yang diselenggarakan sendiri, besaran NSR ditentukan oleh beberapa faktor berikut ini:</p><ol xss="removed">\r\n      <li xss="removed">Jenis reklame</li>\r\n      <li xss="removed">Lokasi</li>\r\n      <li xss="removed">Kategori kelas jalan</li>\r\n      <li xss="removed">Jumlah Reklame</li>\r\n      <li xss="removed">Bahan yang digunakan</li>\r\n      <li xss="removed">Ukuran</li>\r\n      <li xss="removed">Jangka waktu pemasangan</li>\r\n      <li xss="removed">Waktu pemasangan</li>\r\n      </ol><p xss="removed">NSR atau Nilai Sewa Reklame merupakan dasar pengenaan pajak  dan menjadi salah satu faktor dalam perhitungan pajak reklame terutang. Sedangkan jika kita sudah mengetahui nilai sewa reklame kita bisa menghitung pajak reklame yang merupakan pajak atas penyelenggaraan reklame.</p><p xss="removed">Perlu juga diketahui bahwa NSR atas reklame yang diselenggarakan oleh pihak ketiga, perhitungan NSR tersebut biasanya telah diatur dan ditetapkan melalui Nilai Kontrak Reklame. Nilai Kontrak Reklame adalah nilai yang termuat dalam kontrak pembuatan reklame antara pemesan reklame dan pihak ketiga. Khusus untuk penyelenggara reklame melalui pihak ketiga, ada istilah yang namanya Nilai Kontrak Reklame Tidak Wajar, yaitu suatu kondisi dimana ada ketidaksesuaian nilai kontrak reklame tertulis jika dibandingkan pada nilai kontrak reklame yang ada di lapangan. Jika ditemukan adanya nilai kontrak reklame tidak wajar, maka syarat-syarat reklame yang diselenggarakan sendiri akan berlaku seperti yang sudah dijelaskan pada paragraf di atas.</p><h3 xss="removed"><span xss="removed"><b>Penghitungan Tarif Pajak Reklame yang diselenggarakan Sendiri (Studi pada Pemprov DKI Jakarta)</b></span></h3><p xss="removed"><span xss="removed">\r\n      </span></p><p xss="removed">Reklame paling banyak ada di Jakarta, oleh karena itu sering menjadi acuan dari daerah lain. Sesuai dengan Pergub Provinsi DKI Jakarta No. 27 tahun 2014 tentang Penetapan Nilai Sewa Reklame Sebagai Dasar Pengenaan Pajak Reklame, berikut ini adalah tabel hasil perhitungan NSR untuk reklame produk dan non produk (Bilboard/papan/kain):</p><p xss="removed"></p><p xss="removed"><strong>1. Hasil Perhitungan Nilai Sewa Reklame (NSR) Non Produk</strong></p><table><tbody><tr><td><p><strong>No.</strong></p></td><td><p><strong>Lokasi</strong></p></td><td><p><strong>Ukuran</strong></p></td><td><p><strong>Jangka Waktu</strong></p></td><td><p><strong>Ketinggian Reklame</strong></p></td><td><p><strong>NSR (Rp)</strong></p></td></tr><tr><td><p>1.</p></td><td><p>Protokol A</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>25.000</p></td></tr><tr><td><p>2.</p></td><td><p>Protokol B</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>20.000</p></td></tr><tr><td><p>3.</p></td><td><p>Protokol C</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>15.000</p></td></tr><tr><td><p>4.</p></td><td><p>Ekonomi Kelas I</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>10.000</p></td></tr><tr><td><p>5.</p></td><td><p>Ekonomi Kelas II</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>5.000</p></td></tr><tr><td><p>6.</p></td><td><p>Ekonomi Kelas III</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>3.000</p></td></tr><tr><td><p>7.</p></td><td><p>Lingkungan</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>2.000</p></td></tr></tbody></table><p xss="removed">2. <strong>Hasil Perhitungan Nilai Sewa Reklame Produk</strong></p><table><tbody><tr><td><p><strong>No.</strong></p></td><td><p><strong>Lokasi</strong></p></td><td><p><strong>Ukuran</strong></p></td><td><p><strong>Jangka Waktu</strong></p></td><td><p><strong>Ketinggian Reklame</strong></p></td><td><p><strong>NSR (Rp)</strong></p></td></tr><tr><td><p>1.</p></td><td><p>Protokol A</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>125.000</p></td></tr><tr><td><p>2.</p></td><td><p>Protokol B</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>100.000</p></td></tr><tr><td><p>3.</p></td><td><p>Protokol C</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>75.000</p></td></tr><tr><td><p>4.</p></td><td><p>Ekonomi Kelas I</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>50.000</p></td></tr><tr><td><p>5.</p></td><td><p>Ekonomi Kelas II</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>25.000</p></td></tr><tr><td><p>6.</p></td><td><p>Ekonomi Kelas III</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>15.000</p></td></tr><tr><td><p>7.</p></td><td><p>Lingkungan</p></td><td><p>1 M<sup>2</sup></p></td><td><p>1 Hari</p></td><td><p>s.d 15 Meter</p></td><td><p>10.000</p></td></tr></tbody></table><p xss="removed"><b>Berikut ini ilustrasi untuk memudahkan pemahaman perhitungan di atas:</b></p><p xss="removed">Misalnya perusahaan anda ingin memasang Baliho ukuran 3 X 6 meter di area Kuningan (Protokol A) sebanyak 6 buah selama 7 hari maka perhitungannya adalah sebagai berikut:</p><p xss="removed"><i><b>18 m x 6 buah x 125.000 x 7 hari x 25% (Pajak Reklame) = Rp. 23.625.000</b></i></p><p xss="removed">Catatan:</p><ul xss="removed"><li>Biaya tersebut belum termasuk biaya Koordinasi dan Dinas Pertamanan</li><li>Untuk reklame rokok dan minuman beralkohol dikenakan tambahan 25?ri pokok pajak</li></ul><p><span xss="removed"><b>Reklame, Media Paling Banyak Diincar Pemilik Produk untuk Promosi</b></span></p><p><span xss="removed">Tak bisa dipungkiri, majunya sebuah kota seringkali bisa dilihat dari banyaknya reklame yang ada di pinggir jalan strategis di kota tersebut. Selain menimbulkan kesan ramai, reklame sejatinya merupakan alat promosi yang paling efektif untuk diingat masyarakat. Perhitungan pajak reklame diatas bisa memberikan gambaran biaya yang harus dikeluarkan seorang pengusaha untuk berpromosi sehingga bisa menghitung efektifitas dari reklame yang akan dibuat.</span></p><p><b>Sumber : </b> https://www.cermati.com/artikel/pajak-reklame-apa-itu-dan-bagaimana-perhitungannya</p>', '', 1, '20-07-2018', '1532427753', '1532427753');
