INSERT INTO `faqs` (`id`, `pertanyaan`, `jawaban`, `status`, `created_at`, `updated_at`) VALUES
	(22, 'Apakah titik lokasi yang saya miliki cocok untuk dijual?', 'Semua lokasi memiliki potensi untuk dijual. Namun, setelah anda mendaftar kami akan memberikan informasi penilaian kriteria titik lokasi yang mungkin akan berpengaruh terhadap seberapa bagus sebuah view, traffic dan seberapa mudah view itu akan terjual.', 1, '2018-07-09 03:46:35', '2018-07-09 03:46:35'),
	(23, 'Apa keuntungan yang akan saya dapatkan jika bergabung dan menjual titik lokasi saya melalui sistem wiklan.com?', 'Kami akan melakukan proses "revenue sharing" dimana nantinya kita akan membuat kontrak yang disetujui pihak Wiklan dengan anda. Selebihnya, urusan pemasaran dan pencarian klien akan kami handle sehingga anda hanya perlu melakukan pembangunan beserta ijin view serta melengkapi dokumen berdirinya titik lokasi.', 1, '2018-07-09 03:51:58', '2018-07-09 03:51:58'),
	(24, 'Saya tidak memiliki pengalaman asuransi, produksi (pencetakan materi), produksi (kontruksi reklame), dan perijinan . Bagaimana?', 'Kami menyediakan Live Chat di halaman Hubungi Kami jika ada pertanyaan langsung dan panduan untuk anda sehingga anda tidak perlu bingung dalam pelaksanaan asuransi, produksi maupun perijinan. Kita juga akan memberikan database vendor asuransi/produksi/perijinan berkompeten dibidangnya yang anda bisa pakai dalam membantu anda mengurus masalah pembangunan.', 1, '2018-07-09 04:20:39', '2018-07-09 04:20:39'),
	(25, 'Saya tidak ingin berurusan dengan asuransi/produksi/perijinan. Bisakah pihak Wiklan membantu?', 'Jika anda ragu atau tidak mau repot dalam pelaksanaan asuransi, produksi dan pengurusan ijin, anda juga bisa menggunakan jasa kami dalam pengurusan hal tersebut. Namun, akan ada kontrak khusus yang akan kita lakukan yang nantinya juga akan disetujui oleh pihak Wiklan dan anda.', 1, '2018-07-09 04:02:52', '2018-07-09 04:02:52'),
	(26, 'Bagaimana saya melakukan pemesanan titik lokasi di Wiklan?', 'Silahkan anda mendaftar terlebih dahulu di wiklan dan lengkapi informasi detail profil akun anda dengan benar kemudian tunggu approve dari wiklan. Setelah approve anda bisa melihat detail harga dan bisa melakukan proses pemesanan di sistem wiklan atau lebih detail anda bisa lihat Panduan Cara Pemesanan.', 1, '2018-07-09 04:34:26', '2018-07-09 04:34:26');
