INSERT INTO `promo` (`id`, `promo_title`, `promo_slug`, `featured_image`, `promo_desc`, `term_condition`, `voucher_code`, `min_basket_cost`, `discount_operator`, `discount_amount`, `num_voucher`, `start`, `end`, `status`, `created`, `modified`) VALUES
	(1, 'Promo tes', 'promo-tes', '181212092819__MG_8792.jpg', 'Candy canes sesame snaps pudding marzipan. Gingerbread pie fruitcake candy danish jelly beans. Chupa chups bonbon cheesecake macaroon apple pie oat cake pie. Sweet jelly-o sugar plum chocolate danish lollipop danish. Candy powder marshmallow tart dessert danish marshmallow. Lemon drops marshmallow toffee brownie sugar plum.', '<p class="paragraph ng-attr-widget" ng:repeat-index="0" xss=removed><span ng:bind="paragraph.text" class="ng-directive ng-binding">Candy canes sesame snaps pudding marzipan. Gingerbread pie fruitcake candy danish jelly beans. Chupa chups bonbon cheesecake macaroon apple pie oat cake pie. Sweet jelly-o sugar plum chocolate danish lollipop danish. Candy powder marshmallow tart dessert danish marshmallow. Lemon drops marshmallow toffee brownie sugar plum.</span></p><p class="paragraph ng-attr-widget" ng:repeat-index="1" xss=removed><span ng:bind="paragraph.text" class="ng-directive ng-binding">Chupa chups apple pie jujubes brownie pie. Cake candy canes pie cupcake gummies biscuit chocolate bar. Tart apple pie biscuit danish brownie cupcake macaroon macaroon. Dessert pie biscuit. Jelly donut gummi bears jelly macaroon topping pudding muffin bonbon. Marzipan ice cream chocolate bar caramels donut. Ice cream pastry cake jelly-o soufflé bonbon gummies wafer. Danish apple pie dragée chocolate bar jujubes dragée powder.</span></p><p class="paragraph ng-attr-widget" ng:repeat-index="2" xss=removed><span ng:bind="paragraph.text" class="ng-directive ng-binding">Toffee pudding carrot cake chocolate cake halvah cookie cake. Chocolate cake topping pastry. Liquorice jelly-o candy canes cake liquorice sweet roll gingerbread sweet roll cookie. Candy lollipop sesame snaps lollipop jelly beans bonbon chupa chups lollipop. Apple pie marzipan soufflé caramels tart gummies biscuit. Pie muffin marzipan liquorice halvah soufflé sweet roll chocolate bar cupcake. Jelly beans cake muffin chupa chups chocolate cake cotton candy dessert marzipan croissant. Fruitcake toffee caramels macaroon sweet muffin. Sugar plum marshmallow dessert.</span></p><p class="paragraph ng-attr-widget" ng:repeat-index="3" xss=removed><span ng:bind="paragraph.text" class="ng-directive ng-binding">Cupcake lollipop cotton candy biscuit cheesecake chocolate cake dessert danish oat cake. Chupa chups jujubes sugar plum cupcake tiramisu marzipan. Gingerbread carrot cake gummies. Bonbon halvah cupcake ice cream jelly-o gummies candy canes. Bear claw sweet roll carrot cake jelly-o cotton candy brownie. Jelly-o bear claw jujubes carrot cake croissant cupcake.</span></p><p class="paragraph ng-attr-widget" ng:repeat-index="4" xss=removed><span ng:bind="paragraph.text" class="ng-directive ng-binding">Soufflé cheesecake sugar plum jelly-o cake dragée cake. Danish topping dragée. Gummi bears cake pastry cake macaroon wafer. Macaroon caramels bonbon pastry. Gummi bears pie dessert icing cotton candy wafer icing. Chocolate cake liquorice wafer cookie cupcake powder sugar plum dragée. Bear claw jelly beans soufflé jujubes. Chupa chups muffin bear claw tootsie roll jelly oat cake wafer wafer marzipan.</span></p>', 'PROMO1', 50000000, NULL, 10, 20, 1545066000, 1545411600, 1, 1544590414, 1544590414);
